ContactGroup.destroy_all

contacts = Contact.all
group_ids = Group.pluck(:id)

contacts.each do |contact|
  select_group_ids = group_ids.sample(rand(2..4))

  select_group_ids.each do |group_id|
    ContactGroup.create(contact_id: contact.id, group_id: group_ids.sample)
  end
end







